use std::{sync::Arc, time::Duration};

use futures::StreamExt;
use lazy_static::lazy_static;
use models::{Config, Event, EventData, Result};
use redis::{
    aio::{MultiplexedConnection, PubSub},
    AsyncCommands,
};
use regex::Regex;
use tokio::sync::Mutex;
use tokio::time;
use twilight_http::{api_error::ApiError, error::ErrorType, Client};
use twilight_mention::Mention;
use twilight_model::id::{
    marker::{ChannelMarker, UserMarker, WebhookMarker},
    Id,
};
use twilight_validate::{message::MESSAGE_CONTENT_LENGTH_MAX, request::webhook_username};

const WEBHOOK_NAME: &str = "Thang Bridge";
// If only Discord supported svg...
const WEBHOOK_AVATAR: &str =
    "data:image/png;base64,";

async fn get_webhook(
    conn: &mut MultiplexedConnection,
    channel_id: Id<ChannelMarker>,
    http: &twilight_http::Client,
    current_user: Id<UserMarker>,
) -> Result<(Id<WebhookMarker>, String)> {
    // Stored as a hash with `id` and `token`
    let keydb_webhook = conn
        .hgetall::<String, Vec<(String, String)>>(format!("discord:webhook:{}", channel_id))
        .await?;

    if !keydb_webhook.is_empty() {
        log::debug!("Found webhook in keydb: {:?}", keydb_webhook);
        Ok((
            Id::new(
                keydb_webhook
                    .iter()
                    .find(|(k, _)| k == "id")
                    .unwrap()
                    .1
                    .parse::<u64>()?,
            ),
            keydb_webhook
                .iter()
                .find(|(k, _)| k == "token")
                .unwrap()
                .1
                .clone(),
        ))
    } else {
        let webhook = http
            .channel_webhooks(channel_id)
            .await?
            .model()
            .await?
            .into_iter()
            .find(|w| w.user.is_some() && w.user.as_ref().unwrap().id == current_user);

        if let Some(webhook) = webhook {
            conn.hset_multiple::<String, &str, String, ()>(
                format!("discord:webhook:{}", channel_id),
                &[
                    ("id", webhook.id.to_string()),
                    ("token", webhook.token.clone().unwrap()),
                ],
            )
            .await?;
            Ok((webhook.id, webhook.token.unwrap()))
        } else {
            let webhook = http
                .create_webhook(channel_id, WEBHOOK_NAME)?
                .avatar(WEBHOOK_AVATAR)
                .await?
                .model()
                .await?;
            conn.hset_multiple::<String, &str, String, ()>(
                format!("discord:webhook:{}", channel_id),
                &[
                    ("id", webhook.id.to_string()),
                    ("token", webhook.token.clone().unwrap()),
                ],
            )
            .await?;

            Ok((webhook.id, webhook.token.unwrap()))
        }
    }
}

pub async fn handle_redis(
    mut pubsub: PubSub,
    conn: MultiplexedConnection,
    http: Client,
    config: Config,
    current_user: Id<UserMarker>,
) -> Result<()> {
    let conn = Arc::new(Mutex::new(conn));
    lazy_static! {
        static ref EMOJI_REGEX: Regex = Regex::new(r":(\w+):").unwrap();
    }

    for channel in config {
        if channel.discord.is_some() {
            pubsub.subscribe(channel.name).await?;
        }
    }

    let mut pubsub = pubsub.into_on_message();

    while let Some(payload) = pubsub.next().await {
        let channel_name = payload.get_channel_name();
        // TODO: handle more of the errors here
        let payload: String = match payload.get_payload() {
            Ok(payload) => payload,
            Err(err) => {
                log::error!("Could not get pubsub payload: {}", err);
                continue;
            }
        };
        let payload: Event = match serde_json::from_str(&payload) {
            Ok(payload) => payload,
            Err(err) => {
                log::error!("Failed to deserialize event payload: {}", err);
                continue;
            }
        };

        let mut conn = conn.lock().await;
        let channel_ids = conn
            .smembers::<_, Option<Vec<u64>>>(format!("discord:channels:{}", channel_name))
            .await?;

        let channel_ids: Vec<Id<ChannelMarker>> = if let Some(channel_ids) = channel_ids {
            if payload.platform == "discord" {
                let current_id: u64 = payload.identifier.parse().unwrap();
                channel_ids
                    .into_iter()
                    .filter(|id| id != &current_id)
                    .map(Id::new)
                    .collect()
            } else {
                channel_ids.into_iter().map(Id::new).collect()
            }
        } else {
            log::warn!("No channel id found for channel {}", channel_name);
            continue;
        };

        match &payload.data {
            EventData::MessageCreate(msg) => {
                let mut content = msg.content.clone();
                let borrowed = content.clone();

                for channel_id in channel_ids {
                    let (webhook_id, webhook_token) =
                        get_webhook(&mut conn, channel_id, &http, current_user)
                            .await
                            .unwrap();

                    if payload.platform != "discord" {
                        // Ideally this is done once, but I'm not sure how to follow that
                        // with the borrow checker.
                        let captures = EMOJI_REGEX.captures_iter(&borrowed).collect::<Vec<_>>();

                        if !captures.is_empty() {
                            let guild_id = conn
                                .get::<_, Option<u64>>(format!("discord:guild:{}", channel_name))
                                .await?;
                            let guild_id = if let Some(guild_id) = guild_id {
                                Id::new(guild_id)
                            } else {
                                let guild = http
                                    .channel(channel_id)
                                    .await?
                                    .model()
                                    .await?
                                    .guild_id
                                    .unwrap();
                                conn.set::<String, u64, ()>(
                                    format!("discord:guild:{}", channel_name),
                                    guild.into(),
                                )
                                .await?;
                                guild
                            };
                            let emojis =
                                http.emojis(guild_id).await.unwrap().models().await.unwrap();
                            captures.into_iter().for_each(|c| {
                                let found = c.get(0).unwrap().as_str();
                                let name = c.get(1).unwrap().as_str();
                                if let Some(emoji) = emojis.iter().find(|e| e.name == name) {
                                    content = content.replace(found, &emoji.mention().to_string())
                                }
                            })
                        };
                    }

                    let content = if content.len() > MESSAGE_CONTENT_LENGTH_MAX {
                        format!(
                            "{}... truncated message",
                            &content[..MESSAGE_CONTENT_LENGTH_MAX - 21]
                        )
                    } else {
                        content.to_string()
                    };
                    loop {
                        if content.is_empty() {
                            break;
                        }
                        let mut req = match http
                            .execute_webhook(webhook_id, &webhook_token)
                            .content(&content)
                        {
                            Ok(req) => req,
                            Err(err) => {
                                log::error!("Failed to create webhook request: {}", err);
                                break;
                            }
                        };

                        if let Some(avatar) = &msg.avatar {
                            req = req.avatar_url(avatar);
                        }

                        if webhook_username(&msg.author).is_ok() {
                            req = req.username(&msg.author).unwrap();
                        }
                        match req.await {
                            Ok(_) => break,
                            Err(err) => {
                                if let ErrorType::Response {
                                    body: _,
                                    error: ApiError::Ratelimited(ratelimit),
                                    status: _,
                                } = err.kind()
                                {
                                    log::warn!(
                                        "Bridge webhook is ratelimited, waiting {}s",
                                        ratelimit.retry_after
                                    );
                                    time::sleep(Duration::from_secs_f64(ratelimit.retry_after))
                                        .await;
                                } else {
                                    log::error!("Failed to execute webhook: {}", err);
                                    break;
                                }
                            }
                        }
                    }
                }
            }
            // Unreachable now but not for new events.
            #[allow(unreachable_patterns)]
            payload => {
                log::warn!("Unhandled payload from pubsub: {:?}", payload)
            }
        }
    }

    Ok(())
}
